CREATE OR REPLACE FUNCTION public.add_column_if_not_exists(tablename text, columnname text, columntype text)
 RETURNS void
 LANGUAGE plpgsql
AS $function$
BEGIN
  IF NOT EXISTS (
    SELECT 1 FROM information_schema.columns
    WHERE table_name = tablename AND column_name = columnname
  ) THEN
    EXECUTE format('ALTER TABLE %I ADD COLUMN %I %s', tablename, columnname, columntype);
  END IF;
END;
$function$

CREATE OR REPLACE FUNCTION public.execute_sql(sql text)
 RETURNS jsonb
 LANGUAGE plpgsql
 SECURITY DEFINER
 SET search_path TO ''
AS $function$
DECLARE
  result jsonb;
BEGIN
  EXECUTE sql INTO result;
  RETURN result;
EXCEPTION WHEN OTHERS THEN
  RETURN jsonb_build_object(
    'error', SQLERRM,
    'detail', SQLSTATE,
    'context', format('Error occurred in function execute_sql. SQL: %s', sql)
  );
END;
$function$

CREATE OR REPLACE FUNCTION public.execute_sql_v2(sql text, sql_file text DEFAULT NULL::text)
 RETURNS jsonb
 LANGUAGE plpgsql
 SECURITY DEFINER
 SET search_path TO 'public'
AS $function$
declare
  start_time timestamptz := clock_timestamp();
  duration int;
  result jsonb := '{}'::jsonb;
begin
  if sql ~* '(drop|delete|truncate)' then
    raise exception 'Destructive statements not allowed.';
  end if;

  execute sql;

  duration := extract(milliseconds from clock_timestamp() - start_time);

  perform log_sql_execution(sql_file, sql, true, duration);

  result := jsonb_build_object(
    'success', true,
    'duration_ms', duration,
    'sql_file', sql_file
  );

  return result;

exception when others then
  duration := extract(milliseconds from clock_timestamp() - start_time);

  perform log_sql_execution(sql_file, sql, false, duration, SQLERRM);

  return jsonb_build_object(
    'success', false,
    'duration_ms', duration,
    'sql_file', sql_file,
    'error', SQLERRM
  );
end;
$function$
